import React from "react";

import "./App.css";
import { Container, Row, Col } from "react-bootstrap";
import Sidebar from "./components/sidebar/Sidebar";

function App() {
  return (
    <Container>
      <Row>
        <Col>Logo</Col>
        <Col>
          <Sidebar />
        </Col>
      </Row>
      <Row>
        <Col>1 of 3</Col>
        <Col>2 of 3</Col>
        <Col>3 of 3</Col>
      </Row>
    </Container>
  );
}

export default App;
